		    }
		    $StealthCloseFileDelegate = Get-DelegateType @([IntPtr]) ([Void])
			$StealthCloseFile = [System.Runtime.InteropServices.Marshal]::GetDelegateForFunctionPointer($StealthCloseFileAddr, $StealthCloseFileDelegate)

